def compare_expressions(text):
  # Split the text by lines
  lines = text.split("\n")

  # Find the target and predicted lines
  target_line = ""
  predicted_line = ""
  for line in lines:
    if line.startswith("TARGET:"):
      target_line = line
    elif line.startswith("PREDICTED:"):
      predicted_line = line

  # Check if the target and predicted lines are found
  if not target_line or not predicted_line:
    return "Invalid input: target or predicted line not found"

  # Remove the spaces from the target and predicted lines
  target_line = target_line.replace(" ", "")
  target_line=target_line.replace("TARGET:","")
  predicted_line = predicted_line.replace(" ", "")
  predicted_line = predicted_line.replace("PREDICTED:","")

  # Split the target and predicted lines by commas
  target_expressions = target_line.split(",")
  predicted_expressions = predicted_line.split(",")

  # Check if the target and predicted expressions have the same length
  if len(target_expressions) != len(predicted_expressions):
    return "Invalid input: target and predicted expressions have different lengths"

  # Initialize the score list
  score_list = []

  # Loop through the target and predicted expressions
  for i in range(len(target_expressions)):
    # Get the current target and predicted expressions
    target = target_expressions[i]
    predicted = predicted_expressions[i]

    # Initialize the score for the current expressions
    score = 0

    # Compare the target and predicted expressions character by character
    # Use the zip_longest function to handle different lengths
    from itertools import zip_longest
    for t, p in zip_longest(target, predicted, fillvalue=""):
      # If the characters are different, subtract one point from the score
      if t != p:
        score -= 1

    # Append the score to the score list
    score_list.append(score)

  # Return the score list
  return score_list





