# Define a function that takes two strings as input
def detect_insertion(text):
    # Split the text by lines
    lines = text.split("\n")

     # Find the target and predicted lines
    target_line = ""
    predicted_line = ""
    for line in lines:
        if line.startswith("TARGET:"):
            target_line = line
        elif line.startswith("PREDICTED:"):
            predicted_line = line

     # Check if the target and predicted lines are found
    if not target_line or not predicted_line:
        return "Invalid input: target or predicted line not found"

    # Remove the spaces from the target and predicted lines
    target_line = target_line.replace(" ", "")
    s1=target_line.replace("TARGET:","")
    predicted_line = predicted_line.replace(" ", "")
    s2 = predicted_line.replace("PREDICTED:","")


    # Initialize an empty list for the insertion positions
    positions = []
    # Loop through the shorter string and compare it with the longer one
    if len(s1) < len(s2):
        short, long = s1, s2
    else:
        short, long = s2, s1
    i = 0 # Index for the shorter string
    j = 0 # Index for the longer string
    while i < len(short)-1 and j < len(long)-1:
        # If the characters are equal, move to the next ones
        if short[i] == long[j]:
            i += 1
            j += 1
        # If the characters are different, record the position and skip the inserted character
        elif short[i+1] == long[j+1]:
            positions.append(j)
            i+=1
            j+=1

        else:
            positions.append(j)
            j += 1
    # If there are remaining characters in the longer string, record the positions
    while j < len(long):
        positions.append(j)
        j += 1
    # Return the list of insertion positions
    lengthexp=len(s1)
    avgnumberofvariables=len(s1)/4.0
    return positions, lengthexp,avgnumberofvariables

