def concatenate_consecutive(numbers):
    # Initialize an empty list for the output
    output = []
    # Initialize an empty string for the current concatenation
    current = ""
    # Loop through the numbers in the list
    for i, num in enumerate(numbers):
        # If the number is consecutive to the previous one, append it to the current string
        if i > 0 and num == numbers[i-1] + 1:
            current += str(num)
        # Otherwise, add the current string to the output list and start a new string with the number
        else:
            if current:
                output.append(current)
            current = str(num)
    # Add the last string to the output list
    if current:
        output.append(current)
    # Return the output list
    return output

